	<script>

	// Filter Dropdowns Toggle function
	let body = document.querySelector('.body');
	let movToggleBtns = document.querySelectorAll('.movies-list .dropdown-toggle');
	let movToggleMenus = document.querySelectorAll('.movies-list .dropdown-menu');
	let ToggleBtns = document.querySelectorAll('.dropdown-btn');
	let ToggleMenus = document.querySelectorAll('.dropdown-menu');
	let infoBtns = document.querySelectorAll('.info');
	body.addEventListener('mouseup', function (e) {
		movToggleMenus.forEach(menu => {
			if (!menu.parentNode.contains(e.target)) {
				menu.parentNode.classList.remove('active');
			}
		});
		ToggleMenus.forEach(menu => {
			if (!menu.parentNode.contains(e.target)) {
				menu.parentNode.classList.remove('active');
			}
		});
		infoBtns.forEach(btn => {
			if (!btn.parentNode.contains(e.target)) {
				btn.classList.remove('shown');
			}
		});
	});
	movToggleBtns.forEach(btn => {
		btn.addEventListener('click', function (e) {
			e.target.parentNode.classList.toggle('active');
		});
	});
	ToggleBtns.forEach(btn => {
		btn.addEventListener('click', function (e) {
			btn.parentNode.classList.toggle('active');
		});
	});
	infoBtns.forEach(btn => {
		btn.addEventListener('click', function () {
			btn.classList.toggle('shown');
		});
	});


	// Year Dropdown From/To Input Increment/Decrement & clear function
	let movFromInp = document.querySelector('.movies-list .year-dropdown .interval-from input');
	let movFromInc = document.querySelector('.movies-list .year-dropdown .interval-from .increment');
	let movFromDec = document.querySelector('.movies-list .year-dropdown .interval-from .decrement');
	let movToInp = document.querySelector('.movies-list .year-dropdown .interval-to input');
	let movToInc = document.querySelector('.movies-list .year-dropdown .interval-to .increment');
	let movToDec = document.querySelector('.movies-list .year-dropdown .interval-to .decrement');
	let movClearBtn = document.querySelector('.movies-list .year-dropdown .clear-btn');
	movFromInc.addEventListener('click', function () {
		movFromInp.stepUp();
	});
	movFromDec.addEventListener('click', function () {
		movFromInp.stepDown();
	});
	movToInc.addEventListener('click', function () {
		movToInp.stepUp();
	});
	movToDec.addEventListener('click', function () {
		movToInp.stepDown();
	});
	if(movClearBtn){
		movClearBtn.addEventListener('click', function () {
			movFromInp.value = null;
			movToInp.value = null;
		});
	}



	// Year Filter Dropdown Interval Toggle function
	let movIntervals = document.querySelectorAll('.movies-list .year-dropdown .dropdown-item');
	movIntervals.forEach(int => {
		int.addEventListener('click', function (e) {
			for (let i = 0; i < movIntervals.length; i++) {
				movIntervals[i].classList.remove('active');
			}
			e.target.classList.add('active');
		});
	});

	// IMDb Dropdown From/To Input Increment/Decrement & clear function
	let movImdbFromInp = document.querySelector('.movies-list .imdb-dropdown .interval-from input');
	let movImdbFromInc = document.querySelector('.movies-list .imdb-dropdown .interval-from .increment');
